INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000001, 1, "2030/01/01 14:59:59", -416.5, 1, "2025/01/31 12:00:00", "カリン", 190801, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 0.0, 3.414, 2, 1, 62);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000002, 1, "2030/01/01 14:59:59", -416.5, 1, "2025/01/31 12:00:00", "カリン", 190801, "ミッションをクリアして、\n報酬をゲットしましょう！", 0.0, 3.099, 2, 2, 62);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000003, 1, "2030/01/01 14:59:59", -416.5, 1, "2025/01/31 12:00:00", "カリン", 190801, "受け取ることができる\n報酬があるようです\n確認してみてください", 0.0, 2.801, 2, 3, 63);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000004, 1, "2030/01/01 14:59:59", -416.5, 2, "2025/01/31 12:00:00", "カリン", 190801, "報酬がもらえますよ！\nチェックしてみてください", 0.0, 0.0, 2, 4, 63);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000005, 1, "2030/01/01 14:59:59", -363.0, 2, "2025/01/31 12:00:00", "カリン", 190801, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 0.0, 2.12, 1, 5, 64);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000006, 1, "2030/01/01 14:59:59", -363.0, 1, "2025/01/31 12:00:00", "カリン", 190801, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 0.0, 1.68, 2, 6, 64);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000007, 1, "2030/01/01 14:59:59", -363.0, 2, "2025/01/31 12:00:00", "カリン", 190801, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 0.0, 2.33, 1, 7, 64);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020101, 10201, "2030/01/01 14:59:59", -285.0, 3, "2025/01/31 12:00:00", "ラビリスタ", 133701, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0, 5.18, 7, 101, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020102, 10201, "2030/01/01 14:59:59", -285.0, 1, "2025/01/31 12:00:00", "クリスティーナ", 133901, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0, 8.77, 2, 201, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020103, 10201, "2030/01/01 14:59:59", -285.0, 6, "2025/01/31 12:00:00", "ネネカ", 133801, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0, 15.5, 1, 301, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020201, 10202, "2030/01/01 14:59:59", -285.0, 2, "2025/02/28 12:00:00", "ランファ", 134301, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0, 9.061, 5, 101, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020202, 10202, "2030/01/01 14:59:59", -285.0, 1, "2025/02/28 12:00:00", "チカ", 134401, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0, 7.699, 2, 201, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020301, 10203, "2030/01/01 14:59:59", -285.0, 1, "2025/03/31 12:00:00", "アオイ", 134601, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0, 8.595, 2, 101, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020302, 10203, "2030/01/01 14:59:59", -285.0, 1, "2025/03/31 12:00:00", "クローチェ", 134501, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0, 7.758, 2, 201, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020401, 10204, "2030/01/01 14:59:59", -285.0, 2, "2025/04/30 12:00:00", "ルイズマリー", 132302, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0, 7.0, 6, 101, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020402, 10204, "2030/01/01 14:59:59", -285.0, 1, "2025/04/30 12:00:00", "イロハ", 132402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0, 7.904, 2, 201, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020403, 10204, "2030/01/01 14:59:59", -285.0, 4, "2025/04/30 12:00:00", "ソノ", 132502, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0, 8.487, 2, 301, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020502, 10205, "2030/01/01 14:59:59", -285.0, 1, "2025/05/31 12:00:00", "カノン", 134901, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 0.0, 8.763, 2, 101, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020503, 10205, "2030/01/01 14:59:59", -285.0, 1, "2025/05/31 12:00:00", "ツムギ", 134801, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 0.0, 6.417, 3, 201, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020601, 10206, "2030/01/01 14:59:59", -285.0, 3, "2025/06/30 12:00:00", "エリス", 135001, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 0.0, 10.335, 7, 101, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020602, 10206, "2030/01/01 14:59:59", -285.0, 2, "2025/06/30 12:00:00", "シェフィ", 135101, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 0.0, 6.281, 4, 201, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020603, 10206, "2030/01/01 14:59:59", -285.0, 1, "2025/06/30 12:00:00", "プレシア", 135201, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 0.0, 12.244, 2, 301, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020701, 10207, "2030/01/01 14:59:59", -285.0, 2, "2025/07/31 12:00:00", "クリア", 135301, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 0.0, 6.339, 8, 101, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020702, 10207, "2030/01/01 14:59:59", -285.0, 7, "2025/07/31 12:00:00", "アネモネ", 135401, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 0.0, 8.184, 9, 201, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020801, 10208, "2030/01/01 14:59:59", -285.0, 9, "2025/08/31 12:00:00", "アイラ", 129101, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 0.0, 3.906, 2, 101, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020802, 10208, "2030/01/01 14:59:59", -285.0, 1, "2025/08/31 12:00:00", "シナツ", 129201, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 0.0, 14.465, 2, 201, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020803, 10208, "2030/01/01 14:59:59", -285.0, 4, "2025/08/31 12:00:00", "ヒヨリ", 100101, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 0.0, 8.662, 3, 301, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020804, 10208, "2030/01/01 14:59:59", -285.0, 1, "2025/08/31 12:00:00", "レイ", 100301, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 0.0, 10.915, 3, 401, 61);
